import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Home from "../home/_home";
import User from "../users/_index";
import GroupSetting from "../groupSettings/_index";

export default (
	// <BrowserRouter>
		// <Switch>
        //     <Route path="/" exact component={Home} />
		// 	<Route path="/Users" exact component={User} />
		// 	<Route path="/GroupSettings" exact component={GroupSettings} />
		// </Switch>
	// </BrowserRouter>
	<Switch>
		<Route path="/Users">
			<User />
		</Route>
		<Route path="/GroupSettings">
			<GroupSetting />
		</Route>
	</Switch>
);
